type arrayType ={
    id:number,
    name:string,
    surname:string,
    age:number,
    image:string,
    description:string,
    languages:Array<string>,
    experience:number,
    companies:Array<string>
}

type returnType = {
    status:boolean,
    data:arrayType
}

export function getPersonById(id:number):returnType{
    if(id >= People.length){
        return {status:false, data:People[0]} // hiç veri dönmemeli ama çok üşendim
    }
    return {status:true, data:People[id-1]}
}























